import { useEffect, useState } from "react";
import api from "../api";
import "./Projects.css";

/* ================= IMAGE BASE URL ================= */
const BASE_URL = "http://localhost:5000";

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const [showForm, setShowForm] = useState(false);

  const [images, setImages] = useState([]);
  const [floorPlans, setFloorPlans] = useState([]);
  const [amenitiesInput, setAmenitiesInput] = useState("");

  const [form, setForm] = useState({
    projectName: "",
    projectType: "flat",
    location: "",
    totalWings: "",
    totalFloors: "",
    perFloorHouse: "",
    totalPlots: "",
    geoLocation: { lat: "", lng: "" },
  });

  /* ================= FETCH PROJECTS ================= */
  const fetchProjects = async () => {
    try {
      const res = await api.get("/lily/");
      setProjects(res.data.data || []);
    } catch (err) {
      console.error("Fetch error", err);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  /* ================= SUBMIT ================= */
  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();

    formData.append("projectName", form.projectName);
    formData.append("projectType", form.projectType);
    formData.append("location", form.location);

    if (form.projectType === "flat") {
      formData.append("totalWings", form.totalWings);
      formData.append("totalFloors", form.totalFloors);
      formData.append("perFloorHouse", form.perFloorHouse);
    } else {
      formData.append("totalPlots", form.totalPlots);
    }

    if (form.geoLocation.lat && form.geoLocation.lng) {
      formData.append("geoLocation[type]", "Point");
      formData.append("geoLocation[coordinates][0]", form.geoLocation.lng);
      formData.append("geoLocation[coordinates][1]", form.geoLocation.lat);
    }

    if (amenitiesInput) {
      amenitiesInput
        .split(",")
        .map(a => a.trim())
        .forEach(a => formData.append("amenities[]", a));
    }

    images.forEach(img => formData.append("images", img));
    floorPlans.forEach(fp => formData.append("floorPlans", fp));

    try {
      if (editingId) {
        await api.put(`/lily/${editingId}`, formData);
      } else {
        await api.post("/lily/", formData);
      }
      resetForm();
      fetchProjects();
      alert("Saved successfully");
    } catch (err) {
      console.error(err);
      alert("Save failed");
    }
  };

  /* ================= EDIT ================= */
  const handleEdit = (p) => {
    setEditingId(p.id);
    setForm({
      projectName: p.projectName,
      projectType: p.projectType,
      location: p.location,
      totalWings: p.totalWings || "",
      totalFloors: p.totalFloors || "",
      perFloorHouse: p.perFloorHouse || "",
      totalPlots: p.totalPlots || "",
      geoLocation: p.geoLocation?.coordinates
        ? {
            lat: p.geoLocation.coordinates[1],
            lng: p.geoLocation.coordinates[0],
          }
        : { lat: "", lng: "" },
    });
    setAmenitiesInput((p.amenities || []).join(", "));
    setShowForm(true);
  };

  /* ================= DELETE ================= */
  const handleDelete = async (id) => {
    if (!window.confirm("Delete this project?")) return;
    try {
      await api.delete(`/lily/${id}`);
      fetchProjects();
    } catch (err) {
      alert("Delete failed");
    }
  };

  const resetForm = () => {
    setForm({
      projectName: "",
      projectType: "flat",
      location: "",
      totalWings: "",
      totalFloors: "",
      perFloorHouse: "",
      totalPlots: "",
      geoLocation: { lat: "", lng: "" },
    });
    setAmenitiesInput("");
    setImages([]);
    setFloorPlans([]);
    setEditingId(null);
    setShowForm(false);
  };

  /* ================= UI ================= */
  return (
    <div className="projects-page">
      <button className="btn-submit" onClick={() => setShowForm(true)}>
        + Add New Project
      </button>

      {/* ================= FORM ================= */}
      {showForm && (
        <div className="modal">
          <div className="modal-content">
            <h2>{editingId ? "Edit Project" : "Add Project"}</h2>

            <form onSubmit={handleSubmit}>
              <input
                placeholder="Project Name"
                value={form.projectName}
                onChange={(e) =>
                  setForm({ ...form, projectName: e.target.value })
                }
                required
              />

              <select
                value={form.projectType}
                onChange={(e) =>
                  setForm({ ...form, projectType: e.target.value })
                }
              >
                <option value="flat">Flat</option>
                <option value="banglow">Banglow</option>
                <option value="row-house">Row House</option>
              </select>

              <input
                placeholder="Location"
                value={form.location}
                onChange={(e) =>
                  setForm({ ...form, location: e.target.value })
                }
                required
              />

              {form.projectType === "flat" ? (
                <>
                  <input
                    type="number"
                    placeholder="Total Wings"
                    value={form.totalWings}
                    onChange={(e) =>
                      setForm({ ...form, totalWings: e.target.value })
                    }
                  />
                  <input
                    type="number"
                    placeholder="Total Floors"
                    value={form.totalFloors}
                    onChange={(e) =>
                      setForm({ ...form, totalFloors: e.target.value })
                    }
                  />
                  <input
                    type="number"
                    placeholder="Per Floor Houses"
                    value={form.perFloorHouse}
                    onChange={(e) =>
                      setForm({ ...form, perFloorHouse: e.target.value })
                    }
                  />
                </>
              ) : (
                <input
                  type="number"
                  placeholder="Total Plots"
                  value={form.totalPlots}
                  onChange={(e) =>
                    setForm({ ...form, totalPlots: e.target.value })
                  }
                />
              )}

              <input
                placeholder="Amenities (comma separated)"
                value={amenitiesInput}
                onChange={(e) => setAmenitiesInput(e.target.value)}
              />

              <input
                type="file"
                multiple
                onChange={(e) => setImages([...e.target.files])}
              />

              <input
                type="file"
                multiple
                onChange={(e) =>
                  setFloorPlans([...e.target.files].slice(0, 3))
                }
              />

              <button type="submit">
                {editingId ? "Update" : "Create"}
              </button>
              <button type="button" onClick={resetForm}>
                Cancel
              </button>
            </form>
          </div>
        </div>
      )}

      {/* ================= TABLE ================= */}
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Type</th>
            <th>Location</th>
            <th>Images</th>
            <th>Actions</th>
          </tr>
        </thead>

        <tbody>
          {projects.map((p, i) => (
            <tr key={p.id}>
              <td>{i + 1}</td>
              <td>{p.projectName}</td>
              <td>{p.projectType}</td>
              <td>{p.location}</td>

              <td>
                {(p.images || []).map((img, idx) => {
                  con
                  (
                  <img
                    key={idx}
                    src={`${BASE_URL}${img.url}`}
                    alt="project"
                    style={{
                      width: 60,
                      height: 60,
                      objectFit: "cover",
                      borderRadius: 6,
                      marginRight: 6,
                    }}
                  />
                )}
                )}
              </td>

              <td>
                <button onClick={() => handleEdit(p)}>Edit</button>
                <button onClick={() => handleDelete(p.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
